le$1',Adc='Deutsch',Qdc='Dez',Ndc='Dezember',mec='Di',fec='Di.',Nvc='DialogBox',Tvc='DialogBox$1',Rvc='DialogBox$CaptionImpl',Svc='DialogBox$MouseHandler',apc="Die Wettbewerbskommission der Schweiz (Weko) nimmt Kooperationsvereinbarungen zwischen dem f\xFChrenden Telekommunikationsunternehmen Swisscom und \xF6rtlichen Stromversorgern beim Bau von Glasfasernetzen unter die Lupe. Die Swisscom hatte Mitte 2009 angek\xFCndigt, in Ballungsr\xE4umen mit Fibre-to-the-Home (FTTH) k\xFCnftig voll auf Glasfaser zu setzen. Bis 2015 will der Konzern die St\xE4dte Z\xFCrich, Genf, Basel, St. Gallen, Bern, Lausanne und den Kanton Freiburg fl\xE4chendeckend mit FTTH versorgen. Dabei setzt die Swisscom nicht nur auf selbst installierte Glasfaserinfrastrukturen, sondern das Unternehmen will nach M\xF6glichkeit auch Infrastrukturen nutzen, die bereits von \xF6rtlichen Elektrizit\xE4tsversorgern aufgebaut wurden, die den Ausbau eigener Glasfasernetze zuletzt stark vorangetrieben hatten. Und dies ist Wettbewerbern ein Dorn im Auge. So reichte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'.
